    [],nt"revision_timestamp": "2015-06-16T12:15:38.129067",nt"name": "series-information-file-for-the-2014-cartographic-boundary-file-state-county-census-tract-block",nt"isopen":
    true,nt"url": null,nt"notes": "The 2014 cartographic boundary shapefiles
    are simplified representations of selected geographic areas from the U.S. Census
    Bureau's Master Address File / Topologically Integrated Geographic Encoding and
    Referencing (MAF/TIGER) Database (MTDB). These boundary files are specifically designed
    for small-scale thematic mapping. When possible, generalization is performed with
    the intent to maintain the hierarchical relationships among geographies and to maintain
    the alignment of geographies within a file set for a given year. Geographic areas
    may not align with the same areas from another year. Some geographies are available
    as nation-based files while others are available only as state-based files.rnrnBlock
    Groups (BGs) are clusters of blocks within the same census tract. Each census tract
    contains at least one BG, and BGs are uniquely numbered within census tracts.  BGs
    have a valid code range of 0 through 9. BGs have the same first digit of their 4-digit
    census block number from the same decennial census.  For example, tabulation blocks
    numbered 3001, 3002, 3003,.., 3999 within census tract 1210.02 are also within BG
    3 within that census tract.  BGs coded 0 are intended to only include water area,
    no land area, and they are generally in territorial seas, coastal water, and Great
    Lakes water areas. Block groups generally contain  between 600 and 3,000 people.
     A BG usually covers a contiguous area but never crosses county or census tract
    boundaries. They may, however, cross the boundaries of other geographic entities
    like county subdivisions, places, urban areas, voting districts, congressional districts,
    and American Indian / Alaska Native / Native Hawaiian areas.",nt"license_title":
